import { Entry } from "../types";


const PatientEntries: React.FC<{entries: Entry[]}> = ({ entries } ) => {

return (
    entries.map(entry => {
        switch (entry.type) {
          case "Hospital":
            return <div>{entry.date} {entry.description}<br />{entry.diagnosisCodes?.map(diagnose => { return <li key={diagnose}>
                {diagnose} {diagnoses?.find(it => it.code.toLowerCase() === diagnose.toLowerCase())?.name}
              </li> })}</div>;
            case "OccupationalHealthcare":
                return <div>{entry.date} {entry.description}<br />{entry.diagnosisCodes?.map(diagnose => { return <li key={diagnose}>
                    {diagnose} {diagnoses?.find(it => it.code.toLowerCase() === diagnose.toLowerCase())?.name}
                  </li> })}</div>;            
            case "HealthCheck":
                return <div>{entry.date} {entry.description}<br />{entry.diagnosisCodes?.map(diagnose => { return <li key={diagnose}>
                    {diagnose} {diagnoses?.find(it => it.code.toLowerCase() === diagnose.toLowerCase())?.name}
                  </li> })}</div>;
            default:
            return null;
        }

    })
)
}

export default PatientEntries;
